// Path: frontend/src/admin/pages/orders/OrderList.jsx
import { FiPackage, FiDollarSign, FiUser, FiCheck, FiEye } from 'react-icons/fi';
import { Link } from 'react-router-dom';
import { useEffect, useState } from "react";
import axios from "axios";

export default function OrderList() {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  const handleConfirm = (orderId) => {
    // Update order status
    console.log('Confirmed order:', orderId);
  };

  return (
    <div className="p-6 bg-rose-25 ml-64">
      {/* Header */}
      <div className="mb-8">
        <h1 className="text-2xl font-serif font-bold text-rose-800">Order Management</h1>
        <p className="text-amber-900/80">View and manage customer orders</p>
      </div>

      {/* Orders Table */}
      <div className="bg-white rounded-xl shadow-sm border border-rose-100 overflow-hidden">
        <table className="min-w-full divide-y divide-rose-100">
          <thead className="bg-rose-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">Order ID</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">Customer</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">Amount</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">Payment ID</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-amber-900 uppercase tracking-wider">Status</th>
              <th className="px-6 py-3 text-right text-xs font-medium text-amber-900 uppercase tracking-wider">Actions</th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-rose-50">
            {orders.map((order) => (
              <tr key={order.id} className="hover:bg-rose-50/50">
                <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-rose-800">{order.id}</td>
                <td className="px-6 py-4 whitespace-nowrap">
                  <div className="text-sm text-amber-900">{order.userName}</div>
                  <div className="text-xs text-amber-900/60">ID: {order.userId}</div>
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-rose-800 font-medium">{order.totalAmount}</td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-amber-900">{order.paymentId}</td>
                <td className="px-6 py-4 whitespace-nowrap">
                  <span className={`px-2 py-1 text-xs rounded-full ${
                    order.status === 'completed' ? 'bg-green-100 text-green-800' :
                    order.status === 'pending' ? 'bg-amber-100 text-amber-800' :
                    'bg-gray-100 text-gray-800'
                  }`}>
                    {order.status}
                  </span>
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-right text-sm font-medium space-x-2">
                  <Link
                    to={`/admin/orders/${order.id}`}
                    className="inline-flex items-center text-rose-700 hover:text-rose-900"
                    title="View Details"
                  >
                    <FiEye className="mr-1" /> View
                  </Link>
                  {order.status === 'pending' && (
                    <button
                      onClick={() => handleConfirm(order.id)}
                      className="inline-flex items-center text-green-600 hover:text-green-800"
                      title="Confirm Order"
                    >
                      <FiCheck className="mr-1" /> Confirm
                    </button>
                  )}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
